import Nav from "../components/Nav.js";
import Footer from "../components/Footer.js";
import "../components/style/Home.css";

export default function Home() {
  return (
    <div>
      <Nav />
      <section>
        <div className="section-content-1">


        </div>
        <div></div>
      </section>
      <Footer></Footer>
    </div>
  );
}
